function addArticles(data){
    console.log(data)
    $content = d3.select('.content');


    //verbs (top-level)
    verbJoin = $content.selectAll('div')
    .data(data)
    .enter()

    $verb = verbJoin
    .append('div')
    .attr('class','verb-container')

    $verb.append('div')
    .attr('class','verb-name')
    .attr('id', d=>d.verb)
    .text(d=>d.verb)

    //tooltip:
    const $tooltip = $verb
    .append('div')
    .attr('class','tooltip hidden')

    // tooltip: progress bar
    $progressBar = $tooltip
    .append('div')
    .attr('class','tooltip__progress-bar-background')

    $progressBar
    .append('div')
    .attr('class', 'tooltip__progress-bar-foreground')

    // tooltip: text sections
    $tooltip
    .append('p')
    .attr('class','tooltip__meta');

    $tooltip
    .append('p')
    .attr('class','tooltip__hed');

    $tooltip
    .append('p')
    .attr('class','tooltip__other-verbs');

    // nouns (bottom-level)
    nounJoin = $verb
    .selectAll('span')
    .data(d=>d.nouns)
    .enter()

    $noun = nounJoin
    .append('div')
    .attr('class', 'noun')
    .text(function(d){
        return ` ${d.noun} ${generateEmoji()} · `            
